import styled from 'styled-components';

export const Button = styled.button`
    background: ${({primary}) => (primary ? '#000d1a' : '#cd853f')};
    white-space: nowrap;
    outline: none;
    border: none;
    min-width: 100px;
    max-width: 200px;
    cursor: pointer;
    transition: 0.3s;
    display: flex;
    justify-content: center;
    align-items: center;
`;
